<p dir="auto">If the runner is not able to access github.com, any Nodejs versions requested during a workflow run must come from the runner's tool cache. See "<a href="https://docs.github.com/en/enterprise-server@3.2/admin/github-actions/managing-access-to-actions-from-githubcom/setting-up-the-tool-cache-on-self-hosted-runners-without-internet-access">Setting up the tool cache on self-hosted runners without internet access</a>" for more information.</p>
